import 'bootstrap/dist/css/bootstrap.min.css';
import React, { useState } from 'react';
import { Jumbotron, Navbar, NavbarBrand, NavbarToggler, Collapse, Nav, NavItem, NavLink, Container, Button } from 'reactstrap';
import Head from 'next/head';

function HomePage() {
    const [isOpen, setIsOpen] = useState(false);

    const toggle = () => setIsOpen(!isOpen);

    return (
        <div>
            <Head>
                <title>Home Page</title>
                <meta name="description" content="Site de ... sobre ..." />
                <meta name="author" content="Leo Buck" />
                <link rel="shortcut icon" href="/public/favicon.ico" />
            </Head>
            <Navbar color="dark" dark expand="md" className="fixed-top">
                <Container>
                    <NavbarBrand href="/">Site</NavbarBrand>
                    <NavbarToggler onClick={toggle} />
                    <Collapse isOpen={isOpen} navbar>
                        <Nav className="mr-auto" navbar>
                            <NavItem>
                                <NavLink href="/">Sair</NavLink>
                            </NavItem>
                        </Nav>
                    </Collapse>
                </Container>
            </Navbar>
            <Jumbotron fluid className="descr-top">
                <style>{`.descr-top {
                    background-color: #000;
                    color: #FFF;
                    padding-top: 150px;
                    padding-bottom: 100px;
                    margin-bottom: 0rem !important;
                }`}</style>
                <Container className="text-center">
                    <h1 className="display-4 mb-4">Temos a solução que sua empresa precisa!</h1>
                    <p className="lead mb-4">Solicite uma demonstração</p>
                    <Button outline color="warning" size="lg">Entre em contato</Button>
                </Container>
            </Jumbotron>
            <Jumbotron fluid className="servicos">
                <style>{`.servicos {
                    background-color: #FFF;
                    padding-top: 80px;
                    padding-bottom: 80px;
                    margin-bottom: 0rem !important;
                }
                .circulo {
                    width: 140px;
                    height: 140px;
                    background-color: #fed136;
                }
                .centralizar {
                    margin: 0 auto !important
                }`}</style>
                <Container className="text-center">
                    <div>
                        <h2 className="display-4">Serviços</h2>
                        <p className="lead pb-4">Serviços oferecido pela nossa empresa</p>
                    </div>
                    <div className="row">
                        <div className="col-lg-4">
                            <div className="rounded-circle circulo centralizar"></div>
                            <h2 className="mt-4 mb-4">Consultoria</h2>
                            <p>Consultoria</p>
                            <p><a className="btn btn-secondary" href="/">Saiba mais</a></p>
                        </div>
                        <div className="col-lg-4">
                            <h2 className="mt-4 mb-4">Consultoria</h2>
                            <p>Consultoria</p>
                            <p><a className="btn btn-secondary" href="/">Saiba mais</a></p>
                        </div>
                        <div className="col-lg-4">
                            <h2 className="mt-4 mb-4">Consultoria</h2>
                            <p>Consultoria</p>
                            <p><a className="btn btn-secondary" href="/">Saiba mais</a></p>
                        </div> 
                    </div>
                </Container>
            </Jumbotron>
        </div>
    )
}

export default HomePage
